package com.pmp.pet.vo;

import java.sql.Timestamp;

public class Useful {

	private int usefulNo, userNo, freeNo;
	private Timestamp usefulDate;
	
	public Useful() {
		// TODO Auto-generated constructor stub
	}

	public int getUsefulNo() {
		return usefulNo;
	}

	public void setUsefulNo(int usefulNo) {
		this.usefulNo = usefulNo;
	}

	public int getUserNo() {
		return userNo;
	}

	public void setUserNo(int userNo) {
		this.userNo = userNo;
	}

	public int getFreeNo() {
		return freeNo;
	}

	public void setFreeNo(int freeNo) {
		this.freeNo = freeNo;
	}

	public Timestamp getUsefulDate() {
		return usefulDate;
	}

	public void setUsefulDate(Timestamp usefulDate) {
		this.usefulDate = usefulDate;
	}
	
	
}//Useful() end
